import React,{useState} from "react";
import './Login.css';
import { FaUser, FaLock, FaGoogle, FaApple } from "react-icons/fa";
import LoginImg from '../assets/images/Login2.JPG';
import { useNavigate } from "react-router-dom";
import { useAuth } from "../AuthContext";


const Login = () => {
    const [email,setEmail]=useState("");
    const [password,setPassword]=useState("");
    const navigate=useNavigate();
    const { setIsLoggedIn } = useAuth();

    const collectData=()=>{
        console.warn(email,password);
        setIsLoggedIn(true);
        navigate('/');
    }
    return (
        <div className="login-body">
            <img 
            src={LoginImg}
            alt="Login Img"
            className="Loginimg" 
            />
            <div className="wrapper">
                <form action="">
                    <h1>Login</h1>
                    <div className="input-box">
                        <input type="text" placeholder="Email" required 
                        value={email} onChange={(e)=>setEmail(e.target.value)} />
                        <FaUser className="icon" />
                    </div>
                    <div className="input-box">
                        <input type="password" placeholder="Password" required 
                        value={password} onChange={(e)=>setPassword(e.target.value)} />
                        <FaLock className="icon" />
                    </div>
                    <div className="remember-forgot">
                        <label><input type="checkbox" />Remember me</label>
                        <a href="#">Forgot password?</a>
                    </div>
                    <button onClick={collectData} className="loginBut" type="submit">Login</button>

                    <div className="login-options">
                        <p>Or login with</p>
                        <button className="login-google">
                            <FaGoogle className="icon" /> Login with Google
                        </button>
                        <button className="login-apple">
                            <FaApple className="icon" /> Login with Apple
                        </button>
                    </div>
                </form>
            </div>

        </div>
    );
};

export default Login;
